(77, 'widget_text', 'a:4:{i:1;a:4:{s:5:\"title\";s:10:\"Sobre nós\";s:4:\"text\";s:718:\"Guiamos sua obra desde a criação de estruturas até o acabamento. Sempre com muita dedicação, para que possamos entregar um serviço com excelência.\r\n\r\nA Consoares é uma empresa no ramo de construção onde o nosso maior objetivo é prestar serviços com muita qualidade, planejamento, organização e excelência, de maneira que satisfaça nossos clientes. Realizamos serviços desde a estrutura, acabamento, contrapiso, e fachada externa, entre outros serviços.\r\n\r\nJuntamente com o cliente realizamos o planejamento, organização, repassamos o orçamento e alinhamos o cronograma do projeto conforme a necessidade do cliente, buscando sempre prevenir imprevistos que possam atrapalhar o andamento do projeto.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:2;a:4:{s:5:\"title\";s:15:\"Important Links\";s:4:\"text\";s:254:\"<ul>\r\n 	<li><a href=\"https://demo.creativethemes.com/blocksy/charity/privacy-policy/\">Privacy Policy</a></li>\r\n 	<li><a href=\"https://demo.creativethemes.com/blocksy/app/#\">Cookies Policy</a></li>\r\n 	<li><a href=\"#\">Terms &amp; Conditions</a></li>\r\n</ul>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:12:\"Useful Links\";s:4:\"text\";s:259:\"<ul>\r\n 	<li><a href=\"#\">Introduction</a></li>\r\n 	<li><a href=\"https://demo.creativethemes.com/blocksy/app/#\">Our Partners</a></li>\r\n 	<li><a href=\"#\">About Us</a></li>\r\n 	<li><a href=\"https://demo.creativethemes.com/blocksy/app/#\">Our Journeys</a></li>\r\n</ul>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;}', 'yes'),
