(634, 1, '2021-10-23 19:24:38', '2021-10-23 22:24:38', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://demo.creativethemes.com/blocksy/charity/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '576-revision-v1', '', '', '2021-10-23 19:24:38', '2021-10-23 22:24:38', '', 576, 'http://blog.consoares.com.br/?p=634', 0, 'revision', '', 0),
(635, 1, '2021-10-23 19:24:45', '2021-10-23 22:24:45', '<!-- wp:paragraph -->\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sit amet nulla facilisi morbi tempus. Ultrices in iaculis nunc sed augue lacus viverra. Quam vulputate dignissim suspendisse in est ante in. Fringilla est ullamcorper eget nulla facilisi. Amet tellus cras adipiscing enim eu turpis. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Eget nullam non nisi est sit amet facilisis magna. Egestas purus viverra accumsan in nisl nisi scelerisque eu ultrices. Quam pellentesque nec nam aliquam sem et tortor consequat. Elementum integer enim neque volutpat ac. Donec enim diam vulputate ut pharetra. Facilisis volutpat est velit egestas dui id ornare arcu. Sed lectus vestibulum mattis ullamcorper velit sed ullamcorper. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sed faucibus turpis in eu mi bibendum neque egestas congue. Lectus nulla at volutpat diam. Blandit turpis cursus in hac habitasse. Praesent elementum facilisis leo vel fringilla est ullamcorper eget nulla. Quam lacus suspendisse faucibus interdum. Duis at tellus at urna condimentum. Accumsan sit amet nulla facilisi morbi tempus.</p>\n<!-- /wp:paragraph -->', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '577-revision-v1', '', '', '2021-10-23 19:24:45', '2021-10-23 22:24:45', '', 577, 'http://blog.consoares.com.br/?p=635', 0, 'revision', '', 0),
