lectus. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ut pharetra sit amet aliquam id diam maecenas ultricies. Elementum eu facilisis sed odio morbi quis commodo.</p>\n<!-- /wp:paragraph --></div></div></div></div></div></div>\n<!-- /wp:ugb/accordion -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div></div></div></div>\n<!-- /wp:ugb/column -->\n\n<!-- wp:ugb/column {\"uniqueClass\":\"ugb-31dacf9\"} -->\n<div class=\"wp-block-ugb-column ugb-column ugb-31dacf9 ugb-column--design-plain ugb-main-block\"><div class=\"ugb-inner-block\"><div class=\"ugb-block-content\"><div class=\"ugb-column__item ugb-31dacf9-column-wrapper\"><div class=\"ugb-column__content-wrapper\"><!-- wp:ugb/accordion {\"borderRadius\":0,\"onlyOnePanelOpen\":true,\"titleTag\":\"h5\",\"titleFontSize\":17,\"arrowSize\":10,\"containerPaddingTop\":25,\"containerPaddingRight\":25,\"containerPaddingBottom\":25,\"containerPaddingLeft\":25,\"uniqueClass\":\"ugb-794583c\"} -->\n<div class=\"wp-block-ugb-accordion ugb-accordion ugb-794583c ugb-accordion--v2 ugb-accordion--design-basic ugb-accordion--single-open ugb-main-block\" aria-expanded=\"false\"><style>.ugb-794583c .ugb-accordion__heading{border-radius:0px !important;padding-top:25px !important;padding-right:25px !important;padding-bottom:25px !important;padding-left:25px !important}.ugb-794583c .ugb-accordion__title{font-size:17px !important}.ugb-794583c .ugb-accordion__arrow{width:10px !important;height:10px !important}</style><div class=\"ugb-inner-block\"><div class=\"ugb-block-content\"><div class=\"ugb-accordion__item\"><div class=\"ugb-accordion__heading\" role=\"button\" tabindex=\"0\"><h5 class=\"ugb-accordion__title\">Spread awareness about volunteering</h5><svg xmlns=\"http://www.w3.org/2000/svg\" viewbox=\"0 0 20 20\" class=\"ugb-accordion__arrow\" width=\"20\" height=\"20\"><path d=\"M16.7 3.3L10 10 3.3 3.4 0 6.7l10 10v-.1l10-9.9z\"></path></svg></div><div class=\"ugb-accordion__content\" role=\"region\"><di